import React from "react";
import phone from './img/cards-icons/phone3.png'

const Calculator = () => {
  return (
    <>
      {/* <!-- Button trigger modal --> */}
      <button
        type="button"
        className="calculator__btn"
        data-bs-toggle="modal"
        data-bs-target="#staticBackdropcalc"
      >

       <img src={phone} alt=".."/>
      </button>


    </>
  );
};

export default Calculator;
